import java.util.Arrays;
import java.util.Scanner;

class  Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long k = sc.nextInt();
        long[] nums = new long[n];
        for (int i = 0; i < nums.length; i++) {
            nums[i] = sc.nextLong();
        }
        int i = 0;
        int j = n - 1;
        long sumMax = -1;
        long smallest = Long.MAX_VALUE;
        Arrays.sort(nums);
        while (i <= j - 1) {
            long temptSum = nums[i] + nums[j];
            if (temptSum <= k) {
                if (sumMax <= temptSum) {
                    sumMax = temptSum;
                    smallest = Math.min(smallest, nums[j] - nums[i]);
                }
                i++;
            } else if (temptSum > k) {
                j--;
            }
        }
        if (sumMax == -1)
            System.out.println(sumMax + " " + -1);
        else System.out.println(sumMax + " " + smallest);

    }
}
